import React from 'react';
import './Park.css';
import data from './np_from_WIKI.json'

const Park = function (props){
  return (
    <div className="parkBoard">
      <div className="parkAvantar">
        <img src={props.url} className="avantar" alt="logo"/>
      </div>
      <div className="parkInfo">
        <h3>{props.name}</h3>
      </div>
    </div>
  );
}

export default Park;
